import React from 'react';

function User({ user }) {
  return (
    <div>
      <b>{user.username}</b> <span>({user.email})</span>
    </div>
  );
}

function UserList() {
  const users = [
    {
      id: 1,
      username: 'joan',
      email: 'public.joan@gmail.com',
    },
    {
      id: 2,
      username: 'jenson',
      email: 'jenson@gmail.com',
    },
    {
      id: 3,
      username: 'kin',
      email: 'kin@gmail.com',
    },
  ];

  return (
    <>
      <User user={users[0]} />
      <User user={users[1]} />
      <User user={users[2]} />
    </>
  );
}

export default UserList;
